import React from "react";
import { Link } from "react-router-dom";
import "./style.css"

function Nav() {
  return (

    <nav class="navbar navbar-expand-sm bg-light">


      <ul class="navbar-nav">
        <li class="nav-item">
          <a class="nav-link" href="#">Link 1</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">Link 2</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">Link 3</a>
        </li>
      </ul>
    </nav>

  );
}

export default Nav;
